    public final int getMaxNameLength() { return MAX_NAME_LENGTH; }

    public final static int
           NUM_STATES        = 546,
           NT_OFFSET         = 122,
           LA_STATE_OFFSET   = 5977,
           MAX_LA            = 2147483647,
           NUM_RULES         = 539,
           NUM_NONTERMINALS  = 204,
           NUM_SYMBOLS       = 326,
           SEGMENT_SIZE      = 8192,
           START_STATE       = 3490,
           IDENTIFIER_SYMBOL = 0,
           EOFT_SYMBOL       = 120,
           EOLT_SYMBOL       = 120,
           ACCEPT_ACTION     = 5073,
           ERROR_ACTION      = 5438;

